  return (
    <ErrorBoundary fallback={<div>Something went wrong. Try reloading the page, or coming back later.</div>}>
      <TimerProvider>
        <Container>
          <Router>
            <Nav />
            <Routes>
              <Route path="/docs" element={<DocumentationView />} />
              <Route path="/" element={<TimersView />} />
              <Route path="/add" element={<AddView />} />
            </Routes>
          </Router>
        </Container>
      </TimerProvider>
    </ErrorBoundary>
  );
};

export default App;
